<>
<Header />
<NavHeader />
<Layouts>
  <Container>
    <Title>로그인</Title>
    <Body>
      <form>
        <InputArea>
          <InputWrapper>
            <Input
              height="54px"
              fontSize="14px"
              placeholder="아이디를 입력해주세요"
              type="text"
              name="userId"
              value={id}
              onChange={handleId}
            />
          </InputWrapper>
          <InputWrapper>
            <Input
              height="54px"
              fontSize="14px"
              placeholder="비밀번호를 입력해주세요"
              type="password"
              name="password"
              value={pw}
              onChange={handlePw}
            />
          </InputWrapper>
        </InputArea>
        <FindUserInfoArea>
          <p>아이디 찾기</p>
          <span></span>
          <p>비밀번호 찾기</p>
        </FindUserInfoArea>
        <BtnWrapper>
          <Btn
            type="submit"
            width="100%"
            height="54px"
            border="0px none"
            backgroundColor="#efefef"
            color="rgb(51, 51, 51)"
            fontSize="16px"
            onClick={onClickConfirmButton}
          >
            로그인
          </Btn>
          <div style={{ height: "10px" }}></div>
          <Btn
            type="button"
            width="100%"
            height="54px"
            fontSize="16px"
            onClick={() => nav("/signup")}
          >
            회원가입
          </Btn>
        </BtnWrapper>
      </form>
    </Body>
  </Container>
</Layouts>
</>
);
}

